window.bookSummaryJSON = "<p>This is the complete <i>Wizard of Oz</i> collection of 22 stories written by L. Frank Baum.&nbsp;</p> <p>This is the only complete collection that includes all the Oz stories. All 22 stories are fully complete. They include the dedication and the introduction of each story/book.&nbsp;</p> <p>In this collection, you will find stories not available in other collections. It even includes stories published after the death of L. Frank Baum.</p> <p><b>Please Note: There is no list of the stories included with the purchase of this audiobook.</b></p>"; 
